import mongoose from "mongoose";

const userSchema = new mongoose.Schema(
  {
    name: {
      type: String,
      required: true,
    },
    email: {
      type: String,
      required: true,
      unique: true,
    },
    password: {
      type: String,
      required: true,
    },
    image: {
      type: String,
      default:"data:image/jpeg;base64,",
    },
    address: {
      type: Object,
      default: {line1: '', line2: ''}
    },
    gender : {
        type: String,
        default: "Not specified"
    },
    gender : {
        type: String,
        default: "Not specified"
    },
      phone : {
        type: String,
        default: '0000000000'
    },

  },
);

const userModel = mongoose.models.user || mongoose.model("users", userSchema);

export default userModel;